  constructor(private _element: ElementRef) {
    this.chartHeader = 'Health Care Coverage in Nebraska';
  }

  ngAfterViewInit(): void {
    this.draggabillyDirective.onItemsReady('.dashboard');
    let svg = d3.select(this.maleGraphic.nativeElement);
    const svgWidth = +this.maleGraphic.nativeElement.clientWidth;
    const svgHeight = +this.maleGraphic.nativeElement.clientHeight;

    svg.attr('viewBox', `0, 0, ${svgWidth}, ${svgHeight + svgHeight / 10}`);

    let textGroup = svg.append('g')
      .attr('transform', `translate(${svgWidth / 2 - svgWidth / 4}, ${svgHeight / 2})`);

    let text = textGroup.append('text')
      .attr('text-anchor', 'middle')
      .attr('font-size', '45px')
      .attr('font-weight', 'bolder')
      .attr('color', 'red');

    text.append('tspan')
      .text('50%')
      .attr('x', '0')
      .attr('dy', '-.5em')
      .attr('fill', '#a4d6ef');

    text.append('tspan')
      .text('of')
      .attr('x', '0')
      .attr('dy', '1.25em')
      .attr('fill', '#a4d6ef');

    text.append('tspan')
      .text('Men')
      .attr('x', '0')
      .attr('dy', '1.3em')
      .attr('fill', '#a4d6ef');

    svg.append('g')
      .html(this.graphicCache.male[50])
      .attr('transform', `translate(${svgWidth / 2},10)`);


    svg = d3.select(this.femaleGraphic.nativeElement);
    svg.attr('viewBox', `0, 0, ${svgWidth}, ${svgHeight + svgHeight / 10}`);

    textGroup = svg.append('g')
      .attr('transform', `translate(${svgWidth / 2 - svgWidth / 4}, ${svgHeight / 2})`);

    text = textGroup.append('text')
      .attr('text-anchor', 'middle')
      .attr('font-size', '45px')
      .attr('font-weight', 'bolder')
      .attr('color', 'red');

    text = textGroup.append('text')
      .attr('text-anchor', 'middle')
      .attr('font-size', '45px')
      .attr('font-weight', 'bolder');


    text.append('tspan')
      .text('80%')
      .attr('x', '0')
      .attr('dy', '-.5em')
      .attr('fill', '#ff7e7e');

    text.append('tspan')
      .text('of')
      .attr('x', '0')
      .attr('dy', '1.25em')
      .attr('fill', '#ff7e7e');

    text.append('tspan')
      .text('Women')
      .attr('x', '0')
      .attr('dy', '1.3em')
      .attr('fill', '#ff7e7e');


    svg.append('g')
      .html(this.graphicCache.female[80])
      .attr('transform', `translate(${svgWidth / 2},10)`);
  }
